import PropTypes from 'prop-types';
import { useEffect } from 'react';
import { Route, useHistory } from 'react-router-dom';
import { ROUTES } from '../../../../config/constants';
import StartBot from './StartBot/StartBot';
import CopyTelegramId from './CopyTelegramID/Copy Telegram ID';
import EnterTelegramId from './EnterTelegramID/EnterTelegramID';
import ConnectNotification from './ConnectNotification/ConnectNotification';

const Telegram = props => {
    const history = useHistory();

    useEffect(() => {
        history.push(ROUTES.startBot.path);
    }, [ROUTES.startBot.path]);

    return (
        <div className='h-full flex flex-col'>
            <h1 className='text-2xl text-gray-800 font-medium pb-6 mb-10 border-b border-gray-300'>Telegram</h1>
            <div className='max-w-3xl p-10 xl:pr-16 bg-gray-700'>
                <Route path={ROUTES.startBot.path} component={StartBot} />
                <Route path={ROUTES.copyTelegramID.path} component={CopyTelegramId} />
                <Route path={ROUTES.enterTelegramID.path} component={EnterTelegramId} />
                <Route path={ROUTES.connectNotification.path} component={ConnectNotification} />
            </div>
        </div>
    );
};

Telegram.propTypes = {};

export default Telegram;
